import './App.css';
import HomePage from "./Components/HomePage";
import EmployeePage from './Components/EmployeePage';
import Wrapper from './Components/Wrapper';
import ImageOne from './assets/image_One';
import ImageTwo from './assets/Images/image_Two';
import ImageThree from './assets/Images/image_Three';


function App () { 
  return (
    <div className='App'>
      <h1> Main Head</h1>
      <Wrapper>
          <HomePage />
          <EmployeePage />
          <ImageOne/>
          <ImageTwo/>
          <ImageThree/>
          </ Wrapper>

    </div>
  );
    }

export default App;
